🧠敷冰是很常用的方法去處理痛症或受傷。有人相信敷冰可以舒緩痛楚、消腫及促進受傷組織復原。但到底當中有哪些是真的？如果要敷冰，又應該如何做？

🔍在應用冰敷之前，讓我們看看科研如何看待敷冰的效果：
1️⃣在止痛效果方面
止痛是敷冰最顯著的效果。它透過麻痹神經，減慢神經傳送痛楚的信息去大腦，從而減輕痛楚。但這些效果通常都是短暫，痛楚通常很快會復發，而且痛楚減少並不代表組織正在康復。

2️⃣在消腫效果方面
在受傷後的頭72小時，身體正處於發炎階段。在這過程中血管會舒張，令更多負責修補工作的細胞到達受傷部位，並因此導致腫脹。在這個階段敷冰可以有效地控制腫脹。不過一旦發炎階段過去，加上組織液已積聚，敷冰就在無法有消腫功效。

3️⃣在促進組織復原方面
其實發炎現象是一個身體自發修補組織的過程。在動物實驗中，在發炎階段敷冰會阻礙有關修復細胞工作。因此，學者提出敷冰可能會阻礙受傷組織復原。雖然同類研究並未進行人體實驗，但學界對於受傷後應否敷冰並沒有絕對共識。

🤔雖然如此，很多權威仍然提倡受傷後可以敷冰。以下是一些有關敷冰方法的貼士：
1️⃣只在受傷後72小時內敷冰
2️⃣用膠袋裝着碎冰或把受傷部位浸在冰水裏皆可
3️⃣通常每次敷20分鐘，最理想為每兩小時敷一次
4️⃣敷冰很應該在沒沒有痛的情況下，簡單活動受傷部位以促進血液循環

🔥受傷後並非一定要敷冰。不過如果要敷，就一定要用得其所。
