e";s:11:"CEvNJu7HbWO";}i:119;a:1:{s:12:"created_time";i:1599271817;}i:120;a:1:{s:7:"caption";s:1547:"Peripheral Nerve Compression: Know it from your Physiotherapist’s perspective

Nerve compression or pinching of a nerve can occur due to repetitive activities or joint positions that result in compression causing carpal tunnel syndrome (at the wrist) or cubital tunnel syndrome (at the elbow); sprains and injuries which can compress the nerve.
The area where the nerve gets compressed can be sore and inflamed. The person suffering from nerve compression can feel tingling and numbness in addition to pain.
There are a few techniques which alleviate pain resulting from neural compression, however before help in the form of a
Physiotherapist arrives, you can do the following things to ease the pain:

1. Keep the joint in the neutral position by wearing a brace or support
2. Avoid extreme positions which can narrow the joint space
3. Avoid contact with extreme temperatures if the area is numb

To prevent nerve compression pain:

1. You will need to take adequate breaks while doing repetitive tasks
2. Avoid activities which result in pain as this may indicate further damage
3. Do regular nerve stretching exercises – can be taught by your Physiotherapist

If you have any questions, please remember we are always here to help.
